export default {
  data() {
    return {
      products: [],
    };
  },
  methods: {
    async GetProducts() {
      // Mocking products data
      this.products = [
        { id: 1, title: 'Product 1', price: 10, stock: 100 },
        { id: 2, title: 'Product 2', price: 20, stock: 200 },
        { id: 3, title: 'Product 3', price: 30, stock: 300 },
      ];
    },
    async GetProductById(id) {
      // Mocking product by id
      return this.products.find(product => product.id === id);
    },
    async DeleteProduct(id) {
      // Mocking delete product
      this.products = this.products.filter(product => product.id !== id);
    },
    async AddProduct(title, price, stock) {
      // Mocking add product
      const newProduct = {
        id: this.products.length + 1,
        title,
        price,
        stock,
      };
      this.products.push(newProduct);
      console.log('Product added:', newProduct);
    },
    async UpdateProduct(id, product) {
      // Mocking update product
      const index = this.products.findIndex(p => p.id === id);
      if (index !== -1) {
        this.products[index] = { ...this.products[index], ...product };
        console.log('Product updated:', this.products[index]);
      }
    },
  },
};
